import axios from "axios";

const getToken = () => {
    return localStorage.getItem('USER_KEY');
}

export const userLogin = (authRequest) => {
    return axios({
        'method': 'POST',
        'url': `${process.env.hostUrl || 'http://localhost:8181'}/authenticate`,
        'data': authRequest
    })
}
